<!DOCTYPE html>
<html>
<head>
  <title>IMC-RS API</title>
  <meta http-equiv="Content-Type" content="text/html;charset=utf-8">
  <link href='css/hightlight.default.css' media='screen' rel='stylesheet' type='text/css'/>
  <link href='css/screen.css' media='screen' rel='stylesheet' type='text/css'/>
  <script type="text/javascript" src="js/shred.bundle.js" /></script>  
  <script src='js/jquery-1.8.0.min.js' type='text/javascript'></script>
  <script src='js/jquery.slideto.min.js' type='text/javascript'></script>
  <script src='js/jquery.wiggle.min.js' type='text/javascript'></script>
  <script src='js/jquery.ba-bbq.min.js' type='text/javascript'></script>
  <script src='js/handlebars-1.0.0.js' type='text/javascript'></script>
  <script src='js/underscore-min.js' type='text/javascript'></script>
  <script src='js/backbone-min.js' type='text/javascript'></script>
  <script src='js/swagger.js' type='text/javascript'></script>
  <script src='js/swagger-ui.js' type='text/javascript'></script>

  <script src='js/highlight.7.3.pack.js' type='text/javascript'></script>
  <script type="text/javascript">
    $(function () {
      window.swaggerUi = new SwaggerUi({
        url:"/imcrs/api-docs",
        dom_id: "swagger-ui-container",
        supportedSubmitMethods: ['get', 'post', 'put', 'delete'],
        onComplete: function(swaggerApi, swaggerUi){
        if(console) {
          console.log("Loaded SwaggerUI")
        }
        $('pre code').each(function(i, e) {hljs.highlightBlock(e)});
      },
      onFailure: function(data) {
        if(console) {
          console.log("Unable to Load SwaggerUI");
          console.log(data);
        }
      },
      docExpansion: "none"
    });

    $('#input_apiKey').change(function() {
      var key = $('#input_apiKey')[0].value;
      console.log("key: " + key);
      if(key && key.trim() != "") {
        console.log("added key " + key);
        window.authorizations.add("key", new ApiKeyAuthorization("api_key", key, "query"));
      }
    })
    window.swaggerUi.load();
    
    
   // Get api provider
   $.ajax({ url: "/imcrs/rs-docs.json/provider", 
	   type:"GET",
	   context: document.body,
	   success: function(data,type){
	     // Add all provider 
	     $('#api_list').append($('<option/>').attr('value', null).text(""));
    	 $.each(data, function(i,item){
    		console.log(item['providerId'] + " " + item['providerName']);
			var provider = item;
		 	$('#api_list').append($('<option/>').attr('value', provider['providerId']).text(provider['providerName']));
    	 });
    	 $('#input_baseUrl').val("/imcrs/api-docs?cp="+$('#api_list').val());
    	 $('#explore').click();
    }});
	
    // Bind provider select change event
    $('#api_list').change(function () {
    	// Copy the app selection URL to the Swagger address field and
    	// click the Swagger explore button to trigger change of app.
    	$('#input_baseUrl').val("/imcrs/api-docs?cp="+$('#api_list').val());
        $('#explore').click();
    });
  });

    function goUserGuide(){
		window.location.href='userguide/rest_en/index.html';

		return false;
	}
  </script>
  <style type="text/css">
  .input a#userguide{
	  	display: block;
		text-decoration: none;
		font-weight: bold;
		padding: 6px 8px;
		font-size: 0.9em;
		color: white;
		background-color: #547f00;
		-moz-border-radius: 4px;
		-webkit-border-radius: 4px;
		-o-border-radius: 4px;
		-ms-border-radius: 4px;
		-khtml-border-radius: 4px;
		border-radius: 4px;
	}
  </style>
</head>

<body>
<div id='header'>
  <div class="swagger-ui-wrap">
    <a id="logo" href="http://www.h3c.com">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;IMC-RS API</a>
	
    <form id='api_selector'>
      <div class='input'>
		   <select id='api_list'>
		   </select>
	  </div>
      <div class='input'><input placeholder="/imcrs/api-docs" id="input_baseUrl" name="baseUrl" type="text" style="display:none;"/></div>
      <div class='input'><input placeholder="api_key" id="input_apiKey" name="apiKey" type="text" style="display:none;"/></div>
      <div class='input'>
			<a id="explore" href="#">Explore</a>
	   </div>
	   <div class='input'>
			<a id='userguide' href="#" onclick="goUserGuide();return false;">
        	User Guide
	  		</a>
      </div>
    </form>
   
  </div>
</div>

<div id="message-bar" class="swagger-ui-wrap">
  &nbsp;
</div>

<div id="swagger-ui-container" class="swagger-ui-wrap">

</div>

</body>

</html>
